INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (1, 0, 0, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60000, 1, "", 1, "カリン", 0, 190804);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (2, 0, 0, 1, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 60000, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (3, 0, 0, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60000, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (4, 0, 0, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 60000, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (5, 0, 0, 1, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 60000, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (6, 0, 0, 1, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 60000, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (7, 0, 0, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 60000, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (8, 0, 0, 1, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 60000, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (9, 0, 0, 1, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 60000, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (10, 0, 0, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60000, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (11, 0, 0, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60000, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (12, 0, 0, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 60000, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (13, 0, 0, 1, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 60000, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (14, 0, 0, 1, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 60000, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (15, 0, 0, 1, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 60000, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (16, 0, 0, 1, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 60000, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (17, 0, 0, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 60000, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (18, 0, 0, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 60000, 3, "", 2, "カリン", 0, 190804);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (19, 7, 0, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 60000, 3, "", 3, "カリン", 0, 190804);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (20, 1, 0, 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 80001, 0, "", 1, "ハツネ", 0, 101201);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (21, 1, 0, 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 80001, 0, "", 2, "ハツネ", 0, 101201);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (22, 1, 0, 0, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 80001, 1, "", 1, "シオリ", 0, 103801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (23, 1, 0, 0, "来年も、\n一緒にいられたら…\nうれしいな", 80001, 1, "", 2, "シオリ", 0, 103801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (24, 2, 0, 0, "あなたと一緒にいるようになって、\nもう1年ですか…", 80001, 0, "", 1, "キョウカ", 0, 103601);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (25, 2, 0, 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 80001, 0, "", 2, "キョウカ", 0, 103601);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (26, 2, 0, 0, "おにいちゃんとあってから、\n1年たったよ～！", 80001, 1, "", 1, "ミミ", 0, 102001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (27, 2, 0, 0, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 80001, 1, "", 2, "ミミ", 0, 102001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (28, 2, 0, 0, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 80001, 2, "", 1, "ミソギ", 0, 100401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (29, 2, 0, 0, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 80001, 2, "", 2, "ミソギ", 0, 100401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (30, 3, 0, 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 80001, 0, "", 1, "マホ", 0, 101001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (31, 3, 0, 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 80001, 0, "", 2, "マホ", 0, 101001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (32, 3, 0, 0, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 80001, 1, "", 1, "イリヤ", 0, 104401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (33, 3, 0, 0, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 80001, 1, "", 2, "イリヤ", 0, 104401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (34, 3, 0, 0, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 80001, 2, "", 1, "カオリ", 0, 101701);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (35, 3, 0, 0, "これからも、どうぞよろしく\nお願いするさ～！", 80001, 2, "", 2, "カオリ", 0, 101701);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (36, 4, 0, 0, "あんたと出会ってからもうそんなに\nたつのね～", 80001, 0, "", 1, "サレン", 0, 102801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (37, 4, 0, 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 80001, 0, "", 2, "サレン", 0, 102801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (38, 4, 0, 0, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 80001, 1, "", 1, "スズメ", 0, 102501);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (39, 4, 0, 0, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 80001, 1, "", 2, "スズメ", 0, 102501);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (40, 5, 0, 0, "振り返れば、今までいろんなことが\nあったにゃあ…", 80001, 0, "", 1, "タマキ", 0, 104601);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (41, 5, 0, 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 80001, 0, "", 2, "タマキ", 0, 104601);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (42, 5, 0, 0, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 80001, 1, "", 1, "ミフユ", 0, 104801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (43, 5, 0, 0, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 80001, 1, "", 2, "ミフユ", 0, 104801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (44, 6, 0, 0, "あなたさまと出会ってもう1年…", 80001, 0, "", 1, "アキノ", 0, 103201);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (45, 6, 0, 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 80001, 0, "", 2, "アキノ", 0, 103201);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (46, 6, 0, 0, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 80001, 1, "", 1, "ユカリ", 0, 103401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (47, 6, 0, 0, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 80001, 1, "", 2, "ユカリ", 0, 103401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (48, 7, 0, 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 80001, 0, "", 1, "クリスティーナ", 0, 107101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (49, 7, 0, 0, "ともかくこれからも\n愉しませてくれよ☆", 80001, 0, "", 2, "クリスティーナ", 0, 107101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (50, 7, 0, 0, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 80001, 1, "", 1, "ジュン", 0, 104701);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (51, 7, 0, 0, "見えないから分からないって？\nそれもそうだな…", 80001, 1, "", 2, "ジュン", 0, 104701);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (52, 8, 0, 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 80001, 0, "", 1, "トモ", 0, 103701);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (53, 8, 0, 0, "これからもよろしくね！", 80001, 0, "", 2, "トモ", 0, 103701);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (54, 8, 0, 0, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 80001, 1, "", 1, "マツリ", 0, 100501);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (55, 8, 0, 0, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 80001, 1, "", 2, "マツリ", 0, 100501);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (56, 9, 0, 0, "オマエと会って1年なの！\n全然成仏もできなかったし、", 80001, 0, "", 1, "ミヤコ", 0, 100701);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (57, 9, 0, 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 80001, 0, "", 2, "ミヤコ", 0, 100701);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (58, 9, 0, 0, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 80001, 1, "", 1, "シノブ", 0, 103101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (59, 9, 0, 0, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 80001, 1, "", 2, "シノブ", 0, 103101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (60, 10, 0, 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 80001, 0, "", 1, "アンナ", 0, 100901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (61, 10, 0, 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 80001, 0, "", 2, "アンナ", 0, 100901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (62, 10, 0, 0, "君と出会ってもう1年だって！\n早いねー！", 80001, 1, "", 1, "ナナカ", 0, 101301);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (63, 10, 0, 0, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 80001, 1, "", 2, "ナナカ", 0, 101301);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (64, 11, 0, 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 80001, 0, "", 1, "ミツキ", 0, 105101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (65, 11, 0, 0, "これからも、いろんなところを\n調べさせてね？", 80001, 0, "", 2, "ミツキ", 0, 105101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (66, 11, 0, 0, "お前さんと出会ってもう1年か\n助太刀するつもりが", 80001, 1, "", 1, "ルカ", 0, 105601);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (67, 11, 0, 0, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 80001, 1, "", 2, "ルカ", 0, 105601);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (68, 11, 0, 0, "早いものですわね、あなた様と\nお会いして、もう1年…", 80001, 2, "", 1, "エリコ", 0, 102701);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (69, 11, 0, 0, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 80001, 2, "", 2, "エリコ", 0, 102701);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (70, 12, 0, 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 80001, 0, "", 1, "アヤネ", 0, 102301);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (71, 12, 0, 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 80001, 0, "", 2, "アヤネ", 0, 102301);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (72, 12, 0, 0, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 80001, 1, "", 1, "チカ", 0, 104201);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (73, 12, 0, 0, "私のことを見守ってください\nできることなら、ずっと…", 80001, 1, "", 2, "チカ", 0, 104201);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (74, 12, 0, 0, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 80001, 2, "", 1, "クルミ", 0, 102101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (75, 12, 0, 0, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 80001, 2, "", 2, "クルミ", 0, 102101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (76, 13, 0, 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 80001, 0, "", 1, "シズル", 0, 104901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (77, 13, 0, 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 80001, 0, "", 2, "シズル", 0, 104901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (78, 13, 0, 0, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 80001, 1, "", 1, "リノ", 0, 101101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (79, 13, 0, 0, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 80001, 1, "", 2, "リノ", 0, 101101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (80, 14, 0, 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 80001, 0, "", 1, "ユイ", 0, 100201);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (81, 14, 0, 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 80001, 0, "", 2, "ユイ", 0, 100201);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (82, 14, 0, 0, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 80001, 1, "", 1, "ヒヨリ", 0, 100101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (83, 14, 0, 0, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 80001, 1, "", 2, "ヒヨリ", 0, 100101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (84, 14, 0, 0, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 80001, 2, "", 1, "レイ", 0, 100301);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (85, 14, 0, 0, "キミに背中を預けられる日が、\n早くきますように", 80001, 2, "", 2, "レイ", 0, 100301);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (86, 15, 0, 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 80001, 0, "", 1, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (87, 15, 0, 0, "これからもずっと、覚えていて\nくださいね！", 80001, 0, "", 2, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (88, 15, 0, 0, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 80001, 1, "", 1, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (89, 15, 0, 0, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 80001, 1, "", 2, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (90, 15, 0, 0, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 80001, 2, "", 1, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (91, 15, 0, 0, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 80001, 2, "", 2, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (92, 0, 0, 1, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 60001, 1, "", 1, "スズメ", 0, 112101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (93, 0, 0, 1, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 60001, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (94, 0, 0, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60001, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (95, 0, 0, 1, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 60001, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (96, 0, 0, 1, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 60001, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (97, 0, 0, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 60001, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (98, 0, 0, 1, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 60001, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (99, 0, 0, 1, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 60001, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (100, 0, 0, 1, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 60001, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (101, 0, 0, 1, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 60001, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (102, 0, 0, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 60001, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (103, 0, 0, 1, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 60001, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (104, 0, 0, 1, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 60001, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (105, 0, 0, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60001, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (106, 0, 0, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60001, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (107, 0, 0, 1, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 60001, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (108, 0, 0, 1, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 60001, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (109, 0, 0, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 60001, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (110, 0, 0, 1, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 60001, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (111, 0, 0, 1, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 60001, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (112, 0, 0, 1, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 60001, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (113, 0, 0, 1, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 60001, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (114, 0, 0, 1, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 60001, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (115, 0, 0, 1, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 60001, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (116, 0, 0, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 60001, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (117, 0, 0, 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 60001, 3, "", 2, "スズメ", 0, 112101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (118, 7, 0, 0, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 60001, 3, "", 3, "スズメ", 0, 112101);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (119, 1, 0, 0, "ヒューヒュー♪\nドンドンパフパフー♪", 80003, 0, "", 1, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (120, 1, 0, 0, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 80003, 1, "", 1, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (121, 1, 0, 0, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 80003, 1, "", 2, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (122, 1, 0, 0, "え？　ちょっと\nいきなりなにっ？", 80003, 2, "", 1, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (123, 1, 0, 0, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 80003, 2, "", 2, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (124, 1, 0, 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 80003, 0, "", 2, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (125, 1, 0, 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 80003, 0, "", 3, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (126, 1, 0, 0, "ですからその日に向けて\n今から気分を盛り上げているのです", 80003, 1, "", 3, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (127, 1, 0, 0, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 80003, 2, "", 3, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (128, 1, 0, 0, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 80003, 1, "", 4, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (129, 1, 0, 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 80003, 0, "", 4, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (130, 1, 0, 0, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 80003, 2, "", 4, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (131, 1, 0, 0, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 80003, 1, "", 5, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (132, 2, 0, 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 80003, 0, "", 5, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (133, 2, 0, 0, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 80003, 1, "", 1, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (134, 2, 0, 0, "げっ…カリンじゃない\nなんでもないわよ！", 80003, 0, "", 6, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (135, 2, 0, 0, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 80003, 1, "", 2, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (136, 2, 0, 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 80003, 0, "", 7, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (137, 2, 0, 0, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 80003, 1, "", 3, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (138, 2, 0, 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 80003, 0, "", 8, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (139, 2, 0, 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 80003, 0, "", 9, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (140, 2, 0, 0, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 80003, 1, "", 4, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (141, 2, 0, 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 80003, 0, "", 10, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (142, 2, 0, 0, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 80003, 1, "", 5, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (143, 2, 0, 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 80003, 0, "", 11, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (144, 3, 0, 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 80003, 0, "", 6, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (145, 3, 0, 0, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 80003, 1, "", 5, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (146, 3, 0, 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 80003, 0, "", 7, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (147, 3, 0, 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 80003, 0, "", 8, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (148, 3, 0, 0, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 80003, 1, "", 6, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (149, 3, 0, 0, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 80003, 1, "", 7, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (150, 3, 0, 0, "あとは、牧場に素敵な温泉が\n出来たとか…", 80003, 0, "", 9, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (151, 3, 0, 0, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 80003, 1, "", 8, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (152, 3, 0, 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 80003, 0, "", 10, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (153, 3, 0, 0, "えへへ、ありがとうございます\nコッコロちゃん！", 80003, 1, "", 9, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (154, 3, 0, 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 80003, 0, "", 11, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (155, 3, 0, 0, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 80003, 1, "", 10, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (156, 4, 0, 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 80003, 0, "", 11, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (157, 4, 0, 0, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 80003, 1, "", 12, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (158, 4, 0, 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 80003, 0, "", 12, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (159, 4, 0, 0, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 80003, 1, "", 13, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (160, 4, 0, 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 80003, 0, "", 13, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (161, 4, 0, 0, "…積極的？\nなんの話よ？", 80003, 1, "", 14, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (162, 4, 0, 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 80003, 0, "", 14, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (163, 4, 0, 0, "ムーサの町で\nきゃるきゃる～ん☆　って！", 80003, 0, "", 15, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (164, 4, 0, 0, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 80003, 1, "", 15, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (165, 4, 0, 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 80003, 0, "", 16, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (166, 4, 0, 0, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 80003, 1, "", 16, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (167, 4, 0, 0, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 80003, 1, "", 17, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (168, 5, 0, 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 80003, 0, "", 18, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (169, 5, 0, 0, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 80003, 1, "", 12, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (170, 5, 0, 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 80003, 0, "", 19, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (171, 5, 0, 0, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 80003, 1, "", 13, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (172, 5, 0, 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 80003, 0, "", 20, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (173, 5, 0, 0, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 80003, 1, "", 14, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (174, 5, 0, 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 80003, 0, "", 21, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (175, 5, 0, 0, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 80003, 1, "", 15, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (176, 5, 0, 0, "かくし芸？", 80003, 0, "", 22, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (177, 5, 0, 0, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 80003, 1, "", 16, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (178, 5, 0, 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 80003, 0, "", 23, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (179, 6, 0, 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 80003, 0, "", 17, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (180, 6, 0, 0, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 80003, 2, "", 24, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (181, 6, 0, 0, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 80003, 1, "", 17, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (182, 6, 0, 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 80003, 0, "", 18, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (183, 6, 0, 0, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 80003, 2, "", 25, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (184, 6, 0, 0, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 80003, 1, "", 18, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (185, 6, 0, 0, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 80003, 2, "", 26, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (186, 6, 0, 0, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 80003, 2, "", 27, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (187, 6, 0, 0, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 80003, 2, "", 28, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (188, 6, 0, 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 80003, 0, "", 19, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (189, 6, 0, 0, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 80003, 1, "", 19, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (190, 6, 0, 0, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 80003, 2, "", 29, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (191, 7, 0, 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 80003, 0, "", 30, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (192, 7, 0, 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 80003, 0, "", 31, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (193, 7, 0, 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 80003, 0, "", 32, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (194, 7, 0, 0, "あー\nあー\n…声、これで大丈夫かしら？", 80003, 0, "", 33, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (195, 7, 0, 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 80003, 0, "", 34, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (196, 7, 0, 0, "オイッスー☆", 80003, 0, "", 35, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (197, 7, 0, 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 80003, 0, "", 36, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (198, 7, 0, 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 80003, 0, "", 37, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (199, 7, 0, 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 80003, 0, "", 38, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (200, 8, 0, 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 80003, 0, "", 20, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (201, 8, 0, 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 80003, 0, "", 21, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (202, 8, 0, 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 80003, 0, "", 22, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (203, 8, 0, 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 80003, 0, "", 23, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (204, 8, 0, 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 80003, 0, "", 24, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (205, 8, 0, 0, "オイッスー☆", 80003, 0, "", 25, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (206, 8, 0, 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 80003, 0, "", 26, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (207, 8, 0, 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 80003, 0, "", 27, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (208, 8, 0, 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 80003, 0, "", 28, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (209, 9, 0, 0, "オイッスー☆", 80003, 0, "", 20, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (210, 9, 0, 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 80003, 0, "", 21, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (211, 9, 0, 0, "あと６日で2.5周年ですか…", 80003, 0, "", 22, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (212, 9, 0, 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 80003, 0, "", 23, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (213, 9, 0, 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 80003, 0, "", 24, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (214, 9, 0, 0, "オイッスー☆", 80003, 0, "", 25, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (215, 9, 0, 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 80003, 0, "", 26, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (216, 9, 0, 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 80003, 0, "", 27, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (217, 9, 0, 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 80003, 0, "", 28, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (218, 9, 0, 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 80003, 0, "", 29, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (219, 9, 0, 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 80003, 0, "", 30, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (220, 10, 0, 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 80003, 0, "", 31, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (221, 10, 0, 0, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 80003, 1, "", 29, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (222, 10, 0, 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 80003, 0, "", 32, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (223, 10, 0, 0, "…………", 80003, 2, "", 39, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (224, 10, 0, 0, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 80003, 1, "", 30, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (225, 10, 0, 0, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 80003, 2, "", 40, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (226, 10, 0, 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 80003, 0, "", 33, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (227, 10, 0, 0, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 80003, 2, "", 41, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (228, 10, 0, 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 80003, 0, "", 34, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (229, 10, 0, 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 80003, 0, "", 35, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (230, 10, 0, 0, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 80003, 2, "", 42, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (231, 10, 0, 0, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 80003, 1, "", 31, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (232, 10, 0, 0, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 80003, 2, "", 43, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (233, 10, 0, 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 80003, 0, "", 36, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (234, 11, 0, 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 80003, 0, "", 6, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (235, 11, 0, 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 80003, 0, "", 7, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (236, 11, 0, 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 80003, 0, "", 8, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (237, 11, 0, 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 80003, 0, "", 9, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (238, 11, 0, 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 80003, 0, "", 10, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (239, 11, 0, 0, "次にコッコロさんですが\nこちらは発声練習をしています", 80003, 0, "", 11, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (240, 11, 0, 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 80003, 0, "", 12, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (241, 11, 0, 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 80003, 0, "", 13, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (242, 11, 0, 0, "あれ？\nもしかして緊張で気を失って…？", 80003, 0, "", 14, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (243, 11, 0, 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 80003, 0, "", 15, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (244, 11, 0, 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 80003, 0, "", 16, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (245, 11, 0, 0, "それでは\nまた明日お会いしましょう♪", 80003, 0, "", 17, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (246, 12, 0, 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 80003, 0, "", 44, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (247, 12, 0, 0, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 80003, 2, "", 37, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (248, 12, 0, 0, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 80003, 1, "", 32, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (249, 12, 0, 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 80003, 0, "", 45, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (250, 12, 0, 0, "ひどいですよぉキャルちゃ～ん！", 80003, 2, "", 38, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (251, 12, 0, 0, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 80003, 1, "", 33, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (252, 12, 0, 0, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 80003, 2, "", 39, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (253, 12, 0, 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 80003, 0, "", 46, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (254, 12, 0, 0, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 80003, 1, "", 34, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (255, 12, 0, 0, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 80003, 2, "", 40, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (256, 13, 0, 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 80003, 0, "", 41, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (257, 13, 0, 0, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 80003, 2, "", 47, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (258, 13, 0, 0, "忘れてきちゃいました☆", 80003, 0, "", 42, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (259, 13, 0, 0, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 80003, 2, "", 48, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (260, 13, 0, 0, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 80003, 1, "", 35, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (261, 13, 0, 0, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 80003, 2, "", 49, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (262, 13, 0, 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 80003, 0, "", 43, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (263, 13, 0, 0, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 80003, 2, "", 50, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (264, 13, 0, 0, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 80003, 1, "", 36, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (265, 13, 0, 0, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 80003, 2, "", 51, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (266, 13, 0, 0, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 80003, 1, "", 37, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (267, 13, 0, 0, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 80003, 2, "", 52, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (268, 13, 0, 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 80003, 0, "", 44, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (269, 13, 0, 0, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 80003, 1, "", 38, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (270, 13, 0, 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 80003, 0, "", 45, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (271, 13, 0, 0, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 80003, 2, "", 53, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (272, 13, 0, 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 80003, 0, "", 46, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (273, 14, 0, 0, "こんにちは\n【ギルド管理協会】のカリンです", 80003, 0, "", 18, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (274, 14, 0, 0, "昨日の生放送は\nいかがだったでしょうか？", 80003, 0, "", 19, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (275, 14, 0, 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 80003, 0, "", 20, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (276, 14, 0, 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 80003, 0, "", 21, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (277, 14, 0, 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 80003, 0, "", 22, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (278, 14, 0, 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 80003, 0, "", 23, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (279, 14, 0, 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 80003, 0, "", 24, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (280, 14, 0, 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 80003, 0, "", 25, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (281, 14, 0, 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 80003, 0, "", 26, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (282, 14, 0, 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 80003, 0, "", 27, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (283, 15, 0, 0, "準備はいいですかっ？\n…いっきますよー！", 80003, 0, "", 47, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (284, 15, 0, 0, "祝！", 80003, 2, "", 54, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (285, 15, 0, 0, "2.5周年！", 80003, 1, "", 39, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (286, 15, 0, 0, "おめでとうございま～す☆", 80003, 0, "", 48, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (287, 15, 0, 0, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 80003, 2, "", 55, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (288, 15, 0, 0, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 80003, 1, "", 40, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (289, 15, 0, 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 80003, 0, "", 49, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (290, 15, 0, 0, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 80003, 2, "", 56, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (291, 15, 0, 0, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 80003, 1, "", 41, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (292, 15, 0, 0, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 80003, 2, "", 57, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (293, 15, 0, 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 80003, 0, "", 50, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (294, 15, 0, 0, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 80003, 2, "", 58, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (295, 15, 0, 0, "記念日だから\n平気平気♪\nやばいですね☆", 80003, 0, "", 51, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (296, 15, 0, 0, "意味分かんないわよ！", 80003, 2, "", 59, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (297, 15, 0, 0, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 80003, 1, "", 42, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (298, 15, 0, 0, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 80003, 1, "", 43, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (299, 15, 0, 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 80003, 0, "", 52, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (300, 15, 0, 0, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 80003, 2, "", 60, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (301, 15, 0, 0, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 80003, 1, "", 44, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (302, 15, 0, 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 80003, 0, "", 53, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (303, 15, 1, 0, "2.5周年\nありがとうございます！", 80003, 0, "105901,45,106001,61", 54, "ペコリーヌ・コッコロ・キャル", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (304, 0, 0, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60002, 1, "", 1, "カリン", 0, 190804);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (305, 0, 0, 1, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 60002, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (306, 0, 0, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60002, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (307, 0, 0, 1, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 60002, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (308, 0, 0, 1, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 60002, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (309, 0, 0, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 60002, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (310, 0, 0, 1, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 60002, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (311, 0, 0, 1, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 60002, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (312, 0, 0, 1, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 60002, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (313, 0, 0, 1, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 60002, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (314, 0, 0, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 60002, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (315, 0, 0, 1, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 60002, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (316, 0, 0, 1, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 60002, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (317, 0, 0, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60002, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (318, 0, 0, 1, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 60002, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (319, 0, 0, 1, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 60002, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (320, 0, 0, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60002, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (321, 0, 0, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 60002, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (322, 0, 0, 1, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 60002, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (323, 0, 0, 1, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 60002, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (324, 0, 0, 1, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 60002, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (325, 0, 0, 1, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 60002, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (326, 0, 0, 1, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 60002, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (327, 0, 0, 1, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 60002, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (328, 0, 0, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 60002, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (329, 0, 0, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 60002, 3, "", 2, "カリン", 0, 190804);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (330, 7, 0, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 60002, 3, "", 3, "カリン", 0, 190804);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (331, 1, 0, 0, "ささ、シェフィさまはこちらへ…", 80005, 4, "", 1, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (332, 1, 0, 0, "コッコロさん、どこへ行くの…？\n…え？", 80005, 0, "", 1, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (333, 1, 0, 0, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 80005, 3, "", 1, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (334, 1, 0, 0, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 80005, 4, "", 2, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (335, 1, 0, 0, "ええと…\n二人とも何をしているの？", 80005, 0, "", 2, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (336, 1, 0, 0, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 80005, 1, "", 1, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (337, 1, 0, 0, "あの日…？", 80005, 0, "", 3, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (338, 1, 0, 0, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 80005, 3, "", 2, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (339, 1, 0, 0, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 80005, 3, "", 3, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (340, 1, 0, 0, "やばいですね☆", 80005, 2, "", 1, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (341, 1, 0, 0, "って、なにしれっと\n参加してんのよカリン！", 80005, 1, "", 2, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (342, 1, 0, 0, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 80005, 2, "", 2, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (343, 1, 0, 0, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 80005, 2, "", 3, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (344, 1, 0, 0, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 80005, 3, "", 4, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (345, 1, 0, 0, "えっ！？　ええとええと…！\nあ、あと14日…！", 80005, 0, "", 4, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (346, 2, 0, 0, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 80005, 3, "", 5, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (347, 2, 0, 0, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 80005, 1, "", 3, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (348, 2, 0, 0, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 80005, 1, "", 4, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (349, 2, 0, 0, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 80005, 3, "", 6, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (350, 2, 0, 0, "さすがでございます\nペコリーヌさま", 80005, 1, "", 5, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (351, 2, 0, 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 80005, 0, "", 3, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (352, 2, 0, 0, "しゃなり、しゃなり…\nふふ、案外できるものね", 80005, 2, "", 5, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (353, 2, 0, 0, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 80005, 3, "", 7, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (354, 2, 0, 0, "さ、次はキャルさまの\n番でございますよ", 80005, 1, "", 6, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (355, 2, 0, 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 80005, 0, "", 4, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (356, 2, 0, 0, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 80005, 2, "", 6, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (357, 2, 0, 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 80005, 0, "", 5, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (358, 2, 0, 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 80005, 0, "", 6, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (359, 2, 0, 0, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 80005, 1, "", 7, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (360, 2, 0, 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 80005, 0, "", 7, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (361, 3, 0, 0, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 80005, 1, "", 8, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (362, 3, 0, 0, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 80005, 3, "", 8, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (363, 3, 0, 0, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 80005, 1, "", 9, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (364, 3, 0, 0, "聖学祭…って、なにかしら？", 80005, 2, "", 7, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (365, 3, 0, 0, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 80005, 1, "", 10, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (366, 3, 0, 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 80005, 0, "", 8, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (367, 3, 0, 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 80005, 0, "", 9, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (368, 3, 0, 0, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 80005, 3, "", 9, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (369, 3, 0, 0, "いや、そのまんますぎでしょ…", 80005, 0, "", 10, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (370, 3, 0, 0, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 80005, 2, "", 8, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (371, 3, 0, 0, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 80005, 3, "", 10, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (372, 3, 0, 0, "えっ？　ええ…\nぎゅーっ…？", 80005, 2, "", 9, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (373, 4, 0, 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 80005, 0, "", 11, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (374, 4, 0, 0, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 80005, 2, "", 10, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (375, 4, 0, 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 80005, 0, "", 12, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (376, 4, 0, 0, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 80005, 1, "", 11, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (377, 4, 0, 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 80005, 0, "", 13, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (378, 4, 0, 0, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 80005, 3, "", 11, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (379, 4, 0, 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 80005, 0, "", 14, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (380, 4, 0, 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 80005, 0, "", 15, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (381, 4, 0, 0, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 80005, 2, "", 11, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (382, 4, 0, 0, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 80005, 3, "", 12, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (383, 4, 0, 0, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 80005, 1, "", 12, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (384, 4, 0, 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 80005, 0, "", 16, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (385, 4, 0, 0, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 80005, 2, "", 12, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (386, 5, 0, 0, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 80005, 3, "", 13, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (387, 5, 0, 0, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 80005, 3, "", 14, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (388, 5, 0, 0, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 80005, 3, "", 15, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (389, 5, 0, 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 80005, 0, "", 17, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (390, 5, 0, 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 80005, 0, "", 18, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (391, 5, 0, 0, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 80005, 2, "", 13, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (392, 5, 0, 0, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 80005, 1, "", 13, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (393, 5, 0, 0, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 80005, 3, "", 16, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (394, 5, 0, 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 80005, 0, "", 19, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (395, 5, 0, 0, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 80005, 3, "", 17, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (396, 5, 0, 0, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 80005, 3, "", 18, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (397, 5, 0, 0, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 80005, 3, "", 19, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (398, 6, 0, 0, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 80005, 2, "", 4, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (399, 6, 0, 0, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 80005, 2, "", 5, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (400, 6, 0, 0, "…えっ！？", 80005, 1, "", 20, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (401, 6, 0, 0, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 80005, 3, "", 20, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (402, 6, 0, 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 80005, 0, "", 14, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (403, 6, 0, 0, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 80005, 4, "", 14, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (404, 6, 0, 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 80005, 0, "", 15, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (405, 6, 0, 0, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 80005, 1, "", 21, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (406, 6, 0, 0, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 80005, 3, "", 21, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (407, 6, 0, 0, "ぶっ殺すぞ！？", 80005, 1, "", 22, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (408, 6, 0, 0, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 80005, 2, "", 6, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (409, 7, 0, 0, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 80005, 1, "", 15, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (410, 7, 0, 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 80005, 0, "", 23, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (411, 7, 0, 0, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 80005, 2, "", 16, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (412, 7, 0, 0, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 80005, 3, "", 22, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (413, 7, 0, 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 80005, 0, "", 24, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (414, 7, 0, 0, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 80005, 2, "", 17, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (415, 7, 0, 0, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 80005, 1, "", 16, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (416, 7, 0, 0, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 80005, 2, "", 18, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (417, 7, 0, 0, "もちろんでございます\n仲良くお勉強いたしましょう", 80005, 1, "", 17, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (418, 7, 0, 0, "しれっと教育ママが\n生まれてる…？", 80005, 0, "", 25, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (419, 7, 0, 0, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 80005, 3, "", 23, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (420, 7, 0, 0, "え～～～～！？", 80005, 0, "", 26, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (421, 8, 0, 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 80005, 0, "", 27, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (422, 8, 0, 0, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 80005, 2, "", 19, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (423, 8, 0, 0, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 80005, 1, "", 18, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (424, 8, 0, 0, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 80005, 3, "", 24, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (425, 8, 0, 0, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 80005, 2, "", 20, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (426, 8, 0, 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 80005, 0, "", 28, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (427, 8, 0, 0, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 80005, 1, "", 19, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (428, 8, 0, 0, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 80005, 2, "", 21, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (429, 8, 0, 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 80005, 0, "", 29, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (430, 8, 0, 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 80005, 0, "", 30, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (431, 8, 0, 0, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 80005, 3, "", 25, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (432, 8, 0, 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 80005, 0, "", 31, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (433, 9, 0, 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 80005, 0, "", 22, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (434, 9, 0, 0, "…えっ？\n生放送の意気込み！？\n突然なに！？", 80005, 0, "", 23, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (435, 9, 0, 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 80005, 0, "", 24, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (436, 9, 0, 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 80005, 0, "", 25, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (437, 9, 0, 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 80005, 0, "", 26, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (438, 9, 0, 0, "それから、それから…！\nぅ、ぅぅっ…！", 80005, 0, "", 27, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (439, 9, 0, 0, "―びえぇぇ～んっ！！！", 80005, 0, "", 28, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (440, 9, 0, 0, "どうされましたか、シェフィさま", 80005, 1, "", 20, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (441, 9, 0, 0, "ううっ…ひっく…\nママッ…！", 80005, 0, "", 29, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (442, 9, 0, 0, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 80005, 1, "", 21, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (443, 9, 0, 0, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 80005, 1, "", 22, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (444, 9, 0, 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 80005, 0, "", 30, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (445, 10, 0, 0, "主さま\n3.5周年まであと５日\nでございます", 80005, 0, "", 23, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (446, 10, 0, 0, "ですがその前に\n生放送がありますね", 80005, 0, "", 24, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (447, 10, 0, 0, "…生放送に向けた\n意気込みでございますか？", 80005, 0, "", 25, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (448, 10, 0, 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 80005, 0, "", 26, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (449, 10, 0, 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 80005, 0, "", 27, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (450, 10, 0, 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 80005, 0, "", 28, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (451, 10, 0, 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 80005, 0, "", 29, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (452, 10, 0, 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 80005, 0, "", 30, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (453, 10, 0, 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 80005, 0, "", 31, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (454, 11, 0, 0, "3.5周年まであと４日！\nやばいですね☆", 80005, 0, "", 26, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (455, 11, 0, 0, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 80005, 1, "", 32, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (456, 11, 0, 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 80005, 0, "", 27, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (457, 11, 0, 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 80005, 0, "", 28, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (458, 11, 0, 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 80005, 0, "", 29, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (459, 11, 0, 0, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 80005, 1, "", 33, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (460, 11, 0, 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 80005, 0, "", 30, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (461, 11, 0, 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 80005, 0, "", 31, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (462, 11, 0, 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 80005, 0, "", 32, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (463, 11, 0, 0, "だからあたしはやるなんて一言も…", 80005, 1, "", 34, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (464, 11, 0, 0, "オイッスー☆", 80005, 0, "", 33, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (465, 11, 0, 0, "聞きなさいっての！！", 80005, 1, "", 35, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (466, 12, 0, 0, "3.5周年まであと３日…\nそして生放送は、明日…", 80005, 2, "", 31, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (467, 12, 0, 0, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 80005, 2, "", 32, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (468, 12, 0, 0, "おいっす！\n…こうじゃなかったわね\nええと確か…", 80005, 2, "", 33, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (469, 12, 0, 0, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 80005, 2, "", 34, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (470, 12, 0, 0, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 80005, 2, "", 35, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (471, 12, 0, 0, "やってますねシェフィちゃん！", 80005, 3, "", 34, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (472, 12, 0, 0, "なによ、考えることは\nみんな同じってこと？", 80005, 0, "", 36, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (473, 12, 0, 0, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 80005, 1, "", 32, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (474, 12, 0, 0, "みんな…もちろんよ！", 80005, 2, "", 36, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (475, 12, 0, 0, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 80005, 3, "", 35, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (476, 13, 0, 0, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 80005, 2, "", 7, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (477, 13, 0, 0, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 80005, 2, "", 8, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (478, 13, 0, 0, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 80005, 3, "", 36, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (479, 13, 0, 0, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 80005, 2, "", 9, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (480, 13, 0, 0, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 80005, 4, "", 33, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (481, 13, 0, 0, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 80005, 2, "", 10, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (482, 13, 0, 0, "大丈夫…大丈夫…\nあたしは大丈夫…", 80005, 1, "", 37, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (483, 13, 0, 0, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 80005, 2, "", 11, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (484, 13, 0, 0, "あうー？", 80005, 0, "", 37, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (485, 13, 1, 0, "あ…", 80005, 4, "105901,34,106001,38,190801,12", 37, "みんな", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (486, 13, 0, 0, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 80005, 1, "", 39, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (487, 13, 0, 0, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 80005, 4, "", 35, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (488, 13, 0, 0, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 80005, 3, "", 38, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (489, 13, 0, 0, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 80005, 2, "", 13, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (490, 14, 0, 0, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 80005, 2, "", 38, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (491, 14, 0, 0, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 80005, 3, "", 39, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (492, 14, 0, 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 80005, 0, "", 40, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (493, 14, 0, 0, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 80005, 1, "", 36, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (494, 14, 0, 0, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 80005, 2, "", 39, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (495, 14, 0, 0, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 80005, 3, "", 40, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (496, 14, 0, 0, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 80005, 1, "", 37, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (497, 14, 0, 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 80005, 0, "", 41, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (498, 14, 0, 0, "へ、へぇ…", 80005, 2, "", 40, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (499, 14, 0, 0, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 80005, 3, "", 41, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (500, 14, 0, 0, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 80005, 2, "", 41, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (501, 14, 0, 0, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 80005, 2, "", 42, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (502, 15, 0, 0, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 80005, 3, "", 42, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (503, 15, 0, 0, "祝！", 80005, 1, "", 42, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (504, 15, 0, 0, "3.5周年！", 80005, 4, "", 38, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (505, 15, 0, 0, "おめでとうございます！", 80005, 0, "", 43, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (506, 15, 0, 0, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 80005, 2, "", 14, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (507, 15, 0, 0, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 80005, 2, "", 15, "カリン", 0, 190801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (508, 15, 0, 0, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 80005, 3, "", 43, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (509, 15, 0, 0, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 80005, 3, "", 44, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (510, 15, 0, 0, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 80005, 1, "", 43, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (511, 15, 0, 0, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 80005, 1, "", 44, "キャル", 0, 106001);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (512, 15, 0, 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 80005, 0, "", 44, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (513, 15, 0, 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 80005, 0, "", 45, "シェフィ", 0, 106401);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (514, 15, 0, 0, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 80005, 4, "", 39, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (515, 15, 0, 0, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 80005, 4, "", 40, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (516, 15, 0, 0, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 80005, 4, "", 41, "コッコロ", 0, 105901);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (517, 15, 0, 0, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 80005, 3, "", 45, "ペコリーヌ", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (518, 15, 1, 0, "これからも\nよろしくおねがいします！", 80005, 4, "105901,42,106001,45,106401,46,190801,16", 46, "みんな", 0, 105801);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (519, 0, 0, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60003, 1, "", 1, "カリン", 0, 190804);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (520, 0, 0, 1, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 60003, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (521, 0, 0, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60003, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (522, 0, 0, 1, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 60003, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (523, 0, 0, 1, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 60003, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (524, 0, 0, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 60003, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (525, 0, 0, 1, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 60003, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (526, 0, 0, 1, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 60003, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (527, 0, 0, 1, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 60003, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (528, 0, 0, 1, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 60003, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (529, 0, 0, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 60003, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (530, 0, 0, 1, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 60003, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (531, 0, 0, 1, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 60003, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (532, 0, 0, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60003, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (533, 0, 0, 1, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 60003, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (534, 0, 0, 1, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 60003, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (535, 0, 0, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60003, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (536, 0, 0, 2, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 60003, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (537, 0, 0, 1, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 60003, 2, "", 0, "", 4, 0);
