INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (596, 0, 0, 2, "今日の運勢は小吉！　空を眺めると気持ちが晴れやかに！　　　　眺めるだけじゃなくて、ひとっ飛びしちゃいましょうかっ♪", 60005, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (597, 0, 0, 2, "今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」", 60005, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (598, 0, 0, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 60005, 3, "", 2, "カリン", 0, 190804);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (599, 7, 0, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 60005, 3, "", 3, "カリン", 0, 190804);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (600, 0, 0, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60006, 1, "", 1, "カリン", 0, 190804);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (601, 0, 0, 2, "今日の運勢は姫吉！　勇気を持って、新しいことに挑戦しよう！\n幸先がいいねえ少年！　今年もいい一年になるよう祈ってるよ。", 60006, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (602, 0, 0, 2, "今日の運勢は姫吉！　どんなピンチも簡単に乗り越えられそう！\nよい結果が出たようで何よりです。さて、待人の方は……ふふ。", 60006, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (603, 0, 0, 2, "今日の運勢は姫吉！　あの人と仲直り……できちゃうかも！？\nはあ……この私があなたの運勢に興味を抱くわけないでしょう？", 60006, 2, "", 0, "", 1, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (604, 0, 0, 1, "今日の運勢は大吉！　身近な友達との絆が深まる予感……？\n騎士様は、どなたと友誼を結ぶのでしょう？　気になります……", 60006, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (605, 0, 0, 2, "今日の運勢は大吉！　ラッキーアイテムは「蛇の抜け殻」！\nこのアタシにお目にかかれるなんて……アンタ、幸せものね♪", 60006, 2, "", 0, "", 2, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (606, 0, 0, 2, "今日の運勢は中吉！　気になるあの人に会えちゃうかも！？\n『初夢を正夢にする枕』であなたに会え……な、なんでもない！", 60006, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (607, 0, 0, 2, "今日の運勢は中吉！　子供に戻って、一日中遊びつくそう！\nお年玉でけん玉ゲット！　おじちゃん、もしかめ一万回やって！", 60006, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (608, 0, 0, 1, "今日の運勢は中吉！　今日はおうちで、ゆーっくりくつろごう。\nお雑煮よし。みかんよし。さ、こたつで寝正月だ。君も入る？", 60006, 2, "", 0, "", 3, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (609, 0, 0, 2, "今日の運勢は小吉！　突然のドッキリに注意！\nおや、後ろに髪の長い女の霊が──フフ、冗談です。私ですよ。", 60006, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (610, 0, 0, 2, "今日の運勢は小吉。慌てなくても、幸運はきっとやってくる。\n運は自分で掴むもの──媛が言ってました。でも、どうやって？", 60006, 2, "", 0, "", 4, 0);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (611, 0, 0, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 60006, 3, "", 2, "カリン", 0, 190804);
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES (612, 5, 0, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 60006, 3, "", 3, "カリン", 0, 190804);
